import itertools
sequence = []
n = 30 # Gives the sequence for sets {1, ..., 30}
for k in range (1,n):
    adder = 0
    choice = itertools.permutations(range(1,k), r=6)
    for perm in choice:
        if perm[0] == perm[3] + perm[4] + perm[5]:
            if perm[0] == perm[1] + perm[2]:
                adder+=1
    sequence.append(adder//12) # Each combination is counted 12 times
print(sequence)

